import React from 'react';
import PointsOfTable from './data-splan';

const DataTable = ()=> {
    return (
        <ul>
        <li><PointsOfTable label={'Gays'}/></li>
        <li>{PointsOfTable[1]}</li>
        <li>{PointsOfTable[2]}</li>
        <li>{PointsOfTable[3]}</li>  
        </ul>
    );
};
export default DataTable;
